    text: "Empirical validation and characterization of the PRS in large-scale epidemiological studies has not been carried out previously. In addition, more informative PRSs would improve the clinical utility of risk prediction. GWASs have now identified 170 breast cancer susceptibility loci. Moreover, genome-wide heritability estimates indicate that these loci explain only 40% of the heritability explained by all common variants on genome-wide SNP arrays. This suggests that the discrimination provided by the PRS could be improved by incorporating variants associated at more liberal significance thresholds. Many variants confer risks that differ by breast cancer subtype (estrogen-receptor [ER]-positive or -negative), suggesting that subtype-specific PRSs might allow better prediction of subtype-specific disease, including the more aggressive ER-negative breast cancer, and enable selection of women for preventative medication.",
